import { BaseResourceModel } from './base-resource.model';
export class Contratos extends BaseResourceModel {
  constructor(id, dataContrato, dataInicio, dataFim, numeroContrato, situacao, usuario, observacao, valorContrato, pessoasContratanteId, pessoasContratante, pessoasContratadoId, pessoasContratado, tipoGrupoFinanceiroId, tiposGruposFinanceiros) {
    super();
    this.id = id;
    this.dataContrato = dataContrato;
    this.dataInicio = dataInicio;
    this.dataFim = dataFim;
    this.numeroContrato = numeroContrato;
    this.situacao = situacao;
    this.usuario = usuario;
    this.observacao = observacao;
    this.valorContrato = valorContrato;
    this.pessoasContratanteId = pessoasContratanteId;
    this.pessoasContratante = pessoasContratante;
    this.pessoasContratadoId = pessoasContratadoId;
    this.pessoasContratado = pessoasContratado;
    this.tipoGrupoFinanceiroId = tipoGrupoFinanceiroId;
    this.tiposGruposFinanceiros = tiposGruposFinanceiros;
  }
  static fromJson(jsonData) {
    const contratos = {
      ...jsonData,
      pessoasContratanteId: jsonData["pessoasContratante"]["id"],
      pessoasContratadoId: jsonData["pessoasContratado"]["id"],
      tipoGrupoFinanceiroId: jsonData["tiposGruposFinanceiros"]["id"]
    };
    return Object.assign(new Contratos(), contratos);
  }
  static toJson(obj) {
    return Object.assign(new Contratos(), obj);
  }
}
